import { NavLink } from 'react-router-dom';
import './style.css';

const Project = () => {
	return (
			<div>
				<h2>About us</h2>
				<video width="640" height="360" controls>
					<source src={require('./../../img/video.mp4')} type="video/mp4" />
					Your browser does not support the video tag.
				</video>
			</div>
	);
};

export default Project;
